import { useContext } from 'react';
import { Boxlist } from './BoxInformation';
import './DisplayList.css';
//import { Information } from './BoxInformation';
//import { useContext } from 'react';

function DisplayList(){

    const { item } = useContext(Boxlist)

    console.log(item.head)
    
    return(
        <div>
            <ul>
                {item.map(item => {
                    return(
                        <li style={{backgroundColor: 'lightgrey'}}>{item.head}</li>
                    )
                })}
            </ul>
            
        </div>
    )
}

export default DisplayList;
